.contactPage {
	font-family: Arial, sans-serif;
	max-width: 1200px;
	margin: 0 auto;
	padding: 20px;
}

.contactContainer {
	display: flex;
	gap: 40px;
}

.getInTouch {
	flex: 1;
}

.contactInfo {
	flex: 1;
}

.contactForm .formGroup {
	margin-bottom: 15px;
}

.contactForm label {
	display: block;
	margin-bottom: 5px;
}

.contactForm input,
.contactForm select,
.contactForm textarea {
	width: 100%;
	padding: 10px;
	border: 1px solid #ddd;
	border-radius: 4px;
}

.contactForm textarea {
	height: 150px;
}

.sendMessage {
	background-color: black;
	color: white;
	border: none;
	padding: 12px 20px;
	border-radius: 4px;
	cursor: pointer;
}

.contactDetails .detail {
	display: flex;
	align-items: center;
	margin-bottom: 15px;
}

.contactDetails .icon {
	margin-right: 10px;
}

.socialLinks {
	display: flex;
	gap: 15px;
	margin-top: 20px;
}

.mapContainer iframe {
	border-radius: 8px;
	box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
}

@media (max-width: 768px) {
	.contactContainer {
		flex-direction: column;
	}
}
